window.bookSummaryJSON = "<p><b>Having experienced his first survival type Trial, Trent Embra is eager to explore what else the world has to offer.</b></p> <p>There is only one problem. Not everyone comes away from a month of constant fighting untouched. Trent's friend Tersa is unhinged by her time in the Land of the Undying Lord, and Sergeant Cullen means to see her fixed. Enlisted to help, Trent is dragged toward another Trial, mostly willingly. Only time will tell if Tersa still has a place in the Guard and what the Infinite World has in store for Trent.</p>"; 
